// Strategy pattern example\npublic interface IDiagnosticCheck\n{\n    string GetName();\n    bool Execute();\n}\n\npublic class DatabaseConnectionCheck : IDiagnosticCheck\n{\n    public string GetName() => "Database Connection Check";\n    public bool Execute() => /* database connection check logic */;\n}\n\npublic class FilesystemAccessCheck : IDiagnosticCheck\n{\n    public string GetName() => "Filesystem Access Check";\n    public bool Execute() => /* filesystem access check logic */;\n}